import React, {Component} from 'react';

class signUp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      uname: '',
      email: '',
      pwd: '',
    };
  }
  render() {
    const { uname, email, pwd } = this.state;
    return (
      <form onSubmit={() => { this.props.submitForm(uname, email, pwd) }}>
        <label></label>
        <input value={uname} id="username"/>
        <input value={email} id="email"/>
        <input value={pwd} id="password"/>
      </form>
    );
  }
}

export default signUp;
